// Dashboard.js

import React, { useState } from 'react';

const Dashboard = () => {
  const [showProductivity, setShowProductivity] = useState(false);

  const toggleProductivity = () => {
    setShowProductivity(!showProductivity);
  };

  return (
    <div className="dashboard-container" style={{ background: 'linear-gradient(#000E09, #000000)', padding: '20px', color: '#fff' }}>
      <h2 onClick={toggleProductivity} style={{ cursor: 'pointer' }}>Employee Productivity Dashboard</h2>
      {showProductivity && (
        <div className="productivity-data">
          <p>Monday: 80%</p>
          <p>Tuesday: 75%</p>
          <p>Wednesday: 85%</p>
          <p>Thursday: 90%</p>
          <p>Friday: 85%</p>
          <p>Saturday: 70%</p>
        </div>
      )}
    </div>
  );
}

export default Dashboard;
